<!DOCTYPE html>
<html lang="pt-BR">
<head>
  <meta charset="utf-8">
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <title>Visualizador KMZ ‚Ä¢ Fazenda (v9)</title>

  <link rel="stylesheet" href="https://unpkg.com/leaflet@1.9.4/dist/leaflet.css"/>
  <script src="https://unpkg.com/leaflet@1.9.4/dist/leaflet.js"></script>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/jszip/3.10.1/jszip.min.js"></script>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/jspdf/2.5.1/jspdf.umd.min.js"></script>

  <style>
    :root { --pri:#0b7a6e; --pri2:#06564c; --bg:#f7faf9; --tx:#111; }
    *{box-sizing:border-box} html,body{height:100%} body{margin:0;font-family:Inter,system-ui,Segoe UI,Roboto,Arial;background:var(--bg);color:var(--tx)}
    #upload{position:fixed;inset:0;display:grid;place-items:center;background:linear-gradient(135deg,var(--pri),var(--pri2));z-index:10}
    .card{background:#fff;width:min(600px,92vw);padding:22px;border-radius:16px;box-shadow:0 18px 60px rgba(0,0,0,.28)}
    h1{margin:0 0 8px;font-size:20px;color:var(--pri)}
    .row{display:flex;gap:10px;flex-wrap:wrap;align-items:center}
    .btn{background:var(--pri);color:#fff;border:0;padding:12px 16px;border-radius:10px;font-weight:700;cursor:pointer}
    .btn.s{background:#6b7280} .btn:disabled{opacity:.6;cursor:not-allowed}
    #hint{margin-top:6px;font-size:12px;color:#013}
    #app{display:none}
    #sidebar{position:fixed;left:0;top:0;bottom:0;width:360px;background:#fff;border-right:1px solid #e5e7eb;overflow:auto;z-index:2}
    #sidebar .sec{padding:12px 14px;border-bottom:1px solid #eef1f3}
    #map{position:fixed;left:360px;right:0;top:0;bottom:0;z-index:1}
    label{display:block;font-weight:700;color:var(--pri);margin-bottom:6px}
    select{width:100%;padding:10px;border:2px solid var(--pri);border-radius:8px}
    .legend{position:absolute;left:374px;bottom:12px;background:#fff;border:1px solid #e5e7eb;border-radius:8px;padding:8px 10px;font-size:12px;z-index:3}
    .legend .i{display:flex;gap:6px;align-items:center;margin:3px 0} .sw{width:14px;height:14px;border-radius:3px;border:1px solid #ddd}
    .kpi{display:grid;grid-template-columns:1fr 1fr;gap:6px} .kpi .b{background:#e0f2f1;border-radius:8px;padding:8px 10px;font-size:12px;color:#064e3b}
    .list .item{border-left:4px solid var(--pri);border:1px solid #e5e7eb;border-radius:10px;padding:10px;margin:10px 0}
    .thumbs{display:flex;gap:6px;overflow:auto;margin-top:6px} .thumbs img{height:56px;border-radius:6px;border:1px solid #e5e7eb;cursor:pointer}
    .toast{position:fixed;top:12px;right:12px;background:#111;color:#fff;padding:10px 12px;border-radius:8px;z-index:999;opacity:.95;display:none}
    @media(max-width:900px){#sidebar{position:static;width:100%}#map{position:static;width:100%;height:calc(100vh - 360px)}.legend{left:10px}}
    .leaflet-control-layers{max-height:260px; overflow:auto}
    #modal{position:fixed;inset:0;background:rgba(0,0,0,.8);display:none;align-items:center;justify-content:center;z-index:1001}
    #modal img{max-width:92vw;max-height:88vh;border-radius:12px;box-shadow:0 8px 40px rgba(0,0,0,.6)}
    #modal .meta{color:#fff;margin-top:8px;text-align:center;font-size:12px}
  </style>
  <script src="https://cdn.jsdelivr.net/npm/html2canvas@1.4.1/dist/html2canvas.min.js"></script>

<!-- injected: mobile responsive styles v2 -->
<style id="mobile-responsive-styles">
  :root { --vh: 1vh; }
  html, body { height: 100%; }
  body { margin:0; padding:0; }
  /* Map containers common ids/classes */
  #map, #mapid, .map, .leaflet-container {
    min-height: 60vh;
  }
  @media (max-width: 768px) {
    /* Use dynamic viewport height on mobile to avoid URL bar jump */

      height: calc(var(--vh, 1vh) * 100);

    }
    /* Generic grid collapse for two-column layouts */
    .container, .wrapper, .layout, .grid, .row {
      display: block !important;
    }
    /* Sidebars become drawers */
    #sidebar, .sidebar, .sidepanel, .panel-left {
      position: fixed !important;
      top: 0; left: 0;
      height: 100dvh;
      width: min(84vw, 360px);
      max-width: 90vw;
      background: rgba(255,255,255,0.98);
      box-shadow: 2px 0 12px rgba(0,0,0,0.15);
      transform: translateX(-100%);
      transition: transform .25s ease;
      z-index: 9999;
      overflow-y: auto;
      -webkit-overflow-scrolling: touch;
      padding-bottom: 72px;
    }
    /* When open */
    #sidebar.open, .sidebar.open, .sidepanel.open, .panel-left.open {
      transform: translateX(0);
    }
    /* If there is a main content area, ensure it fills width */
    main, #main, .content, .main {
      width: 100% !important;
      margin: 0 !important;
    }
    /* Top bar for actions on mobile */
    .mobile-topbar {
      position: fixed;
      top: 0; left: 0; right: 0;
      height: 48px;
      display: flex;
      align-items: center;
      gap: 8px;
      padding: 0 12px;
      background: rgba(255,255,255,0.9);
      backdrop-filter: blur(6px);
      border-bottom: 1px solid rgba(0,0,0,0.06);
      z-index: 10000;
    }
    .mobile-safe { padding-top: 54px; }
    /* Floating toggle button if you prefer it */
    .sidebar-toggle {
      position: fixed;
      left: 12px;
      bottom: 16px;
      z-index: 10001;
      border: none;
      border-radius: 9999px;
      padding: 12px 14px;
      font-size: 16px;
      box-shadow: 0 6px 16px rgba(0,0,0,0.15);
    }
    /* Touch-friendly controls */
    button, .btn, select, input[type="file"], input[type="text"], .leaflet-control-zoom a {
      min-height: 40px;
      font-size: 16px;
    }
    .leaflet-top, .leaflet-bottom {
      z-index: 1000;
    }
    /* Prevent map controls from overlapping topbar too much */
    .leaflet-top { top: 60px; }
  }
</style>

<body>
  <div id="upload">
    <div class="card">
      <h1>Visualizador de KMZ/KML com Fotos ‚Ä¢ v9</h1>
      <div style="color:#123;font-size:13px;margin-bottom:8px">Carregue o <b>KMZ</b> (ou KML). Limite/UMF/UPAs j√° embutidos no mapa.</div>
      <div class="row" style="margin-bottom:8px">
        <label class="btn">
          üìÅ Selecionar KMZ/KML
          <input id="file-kmz" type="file" accept=".kmz,.kml" style="display:none" />
        </label>
      </div>
      <div id="hint">Dica: voc√™ tamb√©m pode arrastar e soltar o arquivo aqui.</div>
    </div>
  </div>

  <div id="app">
    <aside id="sidebar">
      <div class="sec" style="background:linear-gradient(135deg,var(--pri),var(--pri2));color:#fff">
        <div style="font-weight:800">Relat√≥rio de Ronda</div>
        <div id="meta" style="opacity:.95;font-size:12px">Aguardando arquivo‚Ä¶</div>
      </div>
      <div class="sec">
        <label>M√™s</label>
        <select id="sel-month"></select>
      </div>
      <div class="sec" style="display:flex;flex-wrap:wrap;gap:8px">
        <button class="btn" id="fit">üó∫Ô∏è Ver todos</button>
        <button class="btn s" id="trk">üõ£Ô∏è Trajetos</button>
        <button class="btn" id="pdf" disabled>üìÑ Exportar PDF</button>
      </div>
      <div class="sec">
        <div class="kpi">
          <div class="b">Pontos: <b id="k-p">-</b></div>
          <div class="b">Fotos: <b id="k-f">-</b></div>
          <div class="b">Dias: <b id="k-d">-</b></div>
          <div class="b">Trajetos: <b id="k-t">-</b></div>
        </div>
      </div>
      <div class="sec list" id="lst"></div>
    </aside>
    <div id="map"></div>
    <div class="legend" id="legend" style="display:none"></div>
  </div>

  <div class="toast" id="toast"></div>
  <div id="modal" onclick="hideModal()">
    <div>
      <img id="modal-img" src="" alt=""/>
      <div class="meta" id="modal-meta"></div>
    </div>
  </div>

function initMap() {
  const osm = L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {maxZoom:19, attribution:'¬© OpenStreetMap'});

  App.layers.umf = L.geoJSON(GEOJSON_UMF, { style:{color:'#00838f',weight:2,fillOpacity:.05} }).addTo(App.map);
  App.layers.upas= L.geoJSON(GEOJSON_UPAS,{ style:{color:'#7e57c2',weight:2,dashArray:'6 4',fillOpacity:0} }).addTo(App.map);

// ---------- KMZ/KML READING + DIAGNOSTICS ----------
async function startWith(file) {
  if (!file || !file.name) { toast('Arquivo inv√°lido.'); return; }
  if (!/\.(kmz|kml)$/i.test(file.name)) { toast('Formato n√£o suportado. Selecione um .kmz ou .kml'); return; }

  $('#meta').textContent = `Carregando: ${file.name}`;
  try {
    App.all = await parseFile(file);
  } catch(e) {
    console.error(e);
    toast('Erro ao ler KMZ/KML: '+ (e.message||e));
    return;
  }
  if (!App.all || !Object.keys(App.all.months).length) {
    toast('Nenhum ponto com coordenadas encontrado no arquivo.');
    return;
  }
  $('#upload').style.display='none';
  $('#app').style.display='block';
  if (!App.map) initMap();
  buildMonthOptions();

  let pCount=0, fCount=0; const keys=Object.keys(App.all.months);
  keys.forEach(k=>{ const md=App.all.months[k]; pCount += md.placemarks.length; fCount += md.placemarks.reduce((s,p)=>s+(p.photos?.length||0),0); });
  toast(`OK: ${pCount} pontos | ${fCount} fotos | ${keys.length} m√™s(es)`);
}

async function parseFile(file) {
  const lower = file.name.toLowerCase();
  if (lower.endsWith('.kml')) {
    const text = await file.text();
    return processKML(text, {});
  }
  let zip = null;
  try {
    zip = await JSZip.loadAsync(file);
  } catch(e) {
    const ab = await file.arrayBuffer();
    zip = await JSZip.loadAsync(ab);
  }
  const fileNames = Object.keys(zip.files);
  let kmlKey = fileNames.find(k=>/doc\.kml$/i.test(k)) || fileNames.find(k=>/\.kml$/i.test(k));
  if (!kmlKey) throw new Error('Nenhum .kml dentro do KMZ');
  const kmlString = await zip.file(kmlKey).async('string');

  const photos = {}, byStem = {};
  for (const key of fileNames) {
    if (/\.(jpe?g|png|webp|gif)$/i.test(key)) {
      const b64 = await zip.file(key).async('base64');
      const fname = key.split('/').pop().toLowerCase();
      photos[fname] = b64;
      const st = stem(fname);
      if (st) { if (!byStem[st]) byStem[st] = []; byStem[st].push(fname); }
    }
  }
  return processKML(kmlString, photos, byStem);
}

// ---------- HELPERS ----------
function fnameOnly(hrefOrHtml) {
  if (!hrefOrHtml) return null;
  let s = hrefOrHtml;
  try { s = decodeURIComponent(s); } catch(e) {}
  const m1 = s.match(/<img[^>]+src=["']([^"']+)["']/i);
  const m2 = s.match(/<a[^>]+href=["']([^"']+)["']/i);
  let url = s;
  if (m1 && m1[1]) url = m1[1];
  else if (m2 && m2[1]) url = m2[1];
  const p = url.split('?')[0];
  return p.split('/').pop().toLowerCase();
}
function stem(name) {
  if (!name) return null;
  const base = name.replace(/\.[a-z0-9]+$/i,'').toLowerCase();
  return base.replace(/[^a-z0-9]/gi,'');
}

const PHOTO_KEYS = ['pdfmaps_photos','photo','foto','image','imagem','foto1','foto2','picture','arquivo','file'];
function collectExtendedPhotoNames(pm) {
  const out = [];
  const ed = pm.getElementsByTagName('ExtendedData')[0];
  if (!ed) return out;
  const datas = ed.getElementsByTagName('Data');
  for (const d of datas) {
    const nm = d.getAttribute('name') || '';
    if (PHOTO_KEYS.includes(nm.toLowerCase())) {
      const val = d.getElementsByTagName('value')[0]?.textContent || '';
      if (val) out.push(val);
    }
  }
  const sdVals = ed.getElementsByTagName('SimpleData');
  for (const s of sdVals) {
    const nm = s.getAttribute('name') || '';
    if (PHOTO_KEYS.includes(nm.toLowerCase())) {
      const val = s.textContent || '';
      if (val) out.push(val);
    }
  }
  return out;
}

function parseDate(str) {
  if (!str) return null;
  const d = new Date(str);
  if (!isNaN(d)) return d;
  let m = str.match(/(20\d\d)[-_]?(\d\d)[-_]?(\d\d)/);
  if (m) return new Date(`${m[1]}-${m[2]}-${m[3]}`);
  m = str.match(/(20\d\d)(\d\d)(\d\d)[_T-]?(\d\d)(\d\d)(\d\d)?/);
  if (m) return new Date(`${m[1]}-${m[2]}-${m[3]}T${m[4]}:${m[5]}:${m[6]||'00'}`);
  return null;
}

function tagText(node, tag) { return node.getElementsByTagName(tag)[0]?.textContent?.trim() || ''; }

function getPoint(pm) {
  let coordsNode = pm.getElementsByTagName('Point')[0]?.getElementsByTagName('coordinates')[0]
                || pm.getElementsByTagName('coordinates')[0];
  if (coordsNode) {
    const raw = coordsNode.textContent.trim().split(/[ ,]+/);
    const lon = parseFloat(raw[0]), lat = parseFloat(raw[1]);
    if (!isNaN(lat) && !isNaN(lon)) return [lat,lon];
  }
  const line = pm.getElementsByTagName('LineString')[0]?.getElementsByTagName('coordinates')[0];
  if (line) {
    const arr = line.textContent.trim().split(/\s+/).map(t=>t.split(',').map(parseFloat)).filter(a=>a.length>=2 && !isNaN(a[0]) && !isNaN(a[1]));
    if (arr.length) { const mid = arr[Math.floor(arr.length/2)]; return [mid[1], mid[0]]; }
  }
  return null;
}

// ---------- KML PROCESSOR ----------
function processKML(kmlString, photos, photosByStem={}) {
  const xml = new DOMParser().parseFromString(kmlString,'text/xml');
  const placemarks = Array.from(xml.getElementsByTagName('Placemark'));
  const tracks = Array.from(xml.getElementsByTagNameNS('*','Track'));
  const months = {};
  const colors = ['#2e7d32','#1976d2','#f57c00','#c62828','#7b1fa2','#00796b','#5d4037','#9e9d24','#6d4c41','#8e24aa'];

  for (const pm of placemarks) {
    const pt = getPoint(pm);
    if (!pt) continue;
    const [lat,lon] = pt;
    const name = tagText(pm,'name') || 'Ponto';
    const desc = tagText(pm,'description');

    let dt = null;
    const ts = pm.getElementsByTagName('TimeStamp')[0];
    if (ts) dt = parseDate(tagText(ts,'when'));
    if (!dt) {
      const tspan = pm.getElementsByTagName('TimeSpan')[0];
      if (tspan) dt = parseDate(tagText(tspan,'begin'));
    }
    if (!dt) { const m = (desc.match(/\d{4}-\d{2}-\d{2}/)||[])[0]; if (m) dt = parseDate(m); }
    if (!dt) dt = new Date();

    const hrefs = Array.from(pm.getElementsByTagName('href')).map(n=>n.textContent);
    const inDescImgs = Array.from(desc.matchAll(/<img[^>]+src=["']([^"']+)["']/gi)).map(m=>m[1]);
    const inDescAnch = Array.from(desc.matchAll(/<a[^>]+href=["']([^"']+)["']/gi)).map(m=>m[1]);
    const extNames = collectExtendedPhotoNames(pm);
    let candidates = Array.from(new Set([...hrefs, ...inDescImgs, ...inDescAnch, ...extNames]))
      .map(fnameOnly).filter(Boolean);

    if (!candidates.length) {
      const nst = stem(name);
      if (nst && photosByStem[nst]) candidates.push(...photosByStem[nst]);
      const code = (name.match(/\d{3,}/)||[])[0];
      if (code) for (const st in photosByStem) if (st.includes(code)) candidates.push(...photosByStem[st]);
    }

    const pmPhotos = [];
    for (const c of candidates) {
      const key = (c.includes('.') ? c : (c+'.jpg')).toLowerCase();
      if (photos[key]) pmPhotos.push({ name:key, data:photos[key], date: parseDate(key) || dt });
      else {
        const st = stem(key);
        if (st && photosByStem[st]) {
          for (const alt of photosByStem[st]) {
            if (photos[alt]) pmPhotos.push({ name:alt, data:photos[alt], date: parseDate(alt) || dt });
          }
        }
      }
    }
    pmPhotos.sort((a,b)=> (a.date?.getTime()||0) - (b.date?.getTime()||0));

    const Y = dt.getFullYear(), M = dt.getMonth()+1, D = dt.getDate();
    const mkey = `${Y}-${String(M).padStart(2,'0')}`;
    months[mkey] = months[mkey] || { name: new Date(Y,M-1,1).toLocaleDateString('pt-BR',{month:'long',year:'numeric'}), placemarks:[], tracks:[], days:new Set(), dayColors:{} };
    months[mkey].placemarks.push({name,lat,lon,year:Y,month:M,day:D,desc,photos:pmPhotos, ts: dt});
    months[mkey].days.add(D);
  }

  for (const tr of tracks) {
    const coords = Array.from(tr.getElementsByTagNameNS('*','coord'));
    const line = [];
    for (const c of coords) {
      const [lon,lat] = c.textContent.trim().split(/[ \s]+/).map(parseFloat);
      if (!isNaN(lat)&&!isNaN(lon)) line.push([lat,lon]);
    }
    if (line.length) Object.keys(months).forEach(k=>months[k].tracks.push({coordinates:line}));
  }

  for (const k of Object.keys(months)) {
    const m = months[k];
    m.days = Array.from(m.days).sort((a,b)=>a-b);
    m.days.forEach((d,i)=> m.dayColors[d] = colors[i % colors.length]);
    m.placemarks.sort((a,b)=> (a.ts?.getTime()||0)-(b.ts?.getTime()||0) || a.name.localeCompare(b.name));
  }
  return {months};
}

// ---------- UI BUILD ----------
function buildMonthOptions() {
  const sel = $('#sel-month'); sel.innerHTML='';
  const keys = Object.keys(App.all.months).sort();
  if (!keys.length) { toast('Nenhum m√™s encontrado'); return; }
  keys.forEach(k=>{ const o=document.createElement('option'); o.value=k; o.textContent=App.all.months[k].name.replace(/^./,c=>c.toUpperCase()); sel.appendChild(o); });
  sel.onchange = onChangeMonth;
  onChangeMonth();
}

function clearLayers() {
  App.layers.markers.forEach(m=>App.map.removeLayer(m)); App.layers.markers=[];
  App.layers.tracks.forEach(l=>App.map.removeLayer(l));  App.layers.tracks=[];
  $('#lst').innerHTML=''; $('#legend').style.display='none'; $('#pdf').disabled=true;
}

function drawLegend(md) {
  const Lg = $('#legend'); Lg.innerHTML='<b>Dias</b>';
  md.days.forEach(d=>{ const div=document.createElement('div'); div.className='i'; div.innerHTML=`<span class="sw" style="background:${md.dayColors[d]}"></span> Dia ${d}`; Lg.appendChild(div); });
  Lg.style.display = 'block';
}

function drawMonth(md) {
  drawLegend(md);
  const grpTracks = L.layerGroup();
  md.tracks.forEach((t,i)=>{ const d=md.days[i%md.days.length]; const col=md.dayColors[d]; L.polyline(t.coordinates,{color:col,weight:2,opacity:.85}).addTo(grpTracks); });
  grpTracks.addTo(App.map);
  App.layers.tracks = [grpTracks];
  const grpPts = L.layerGroup(); App.layers.markers = [];
  let list='';
  md.placemarks.forEach((pm,idx)=>{
    const col = md.dayColors[pm.day] || '#1976d2';
    const icon=L.divIcon({html:`<div style="background:${col};color:#fff;width:30px;height:30px;border-radius:50%;display:flex;align-items:center;justify-content:center;font-weight:800;border:3px solid #fff;box-shadow:0 2px 8px rgba(0,0,0,.35)">${idx+1}</div>`, className:'', iconSize:[30,30]});
    const marker=L.marker([pm.lat,pm.lon],{icon}).addTo(grpPts);
    const shots=(pm.photos||[]).map(ph=>`<img src="data:image/jpeg;base64,${ph.data}" alt="${ph.name}" title="${ph.name}" onclick="showModal('data:image/jpeg;base64,${ph.data}', '${ph.name}', ${pm.lat}, ${pm.lon})" />`).join('');
    const dateStr = `${String(pm.day).padStart(2,'0')}/${String(pm.month).padStart(2,'0')}/${pm.year}`;
    marker.bindPopup(`<div style="min-width:240px"><b>Ponto ${idx+1}</b><div style="font-size:12px;color:#444;margin:6px 0">${dateStr} ‚Ä¢ Lat/Lon: ${pm.lat.toFixed(6)}, ${pm.lon.toFixed(6)}</div>${shots?`<div class='thumbs'>${shots}</div>`:`<div style='font-size:12px;color:#777'>Sem fotos</div>`}</div>`);
    App.layers.markers.push(marker);
    list += `<div class="item" onclick="goToPoint(${idx})">
      <div style="display:flex;gap:10px;align-items:center">
        <div style="width:28px;height:28px;border-radius:50%;display:grid;place-items:center;background:${col};color:#fff;font-weight:800">${idx+1}</div>
        <div style="flex:1">
          <div style="font-weight:700">${pm.name.replace(/</g,'&lt;').slice(0,80)}</div>
          <div style="font-size:12px;color:#555">${dateStr} ‚Ä¢ ${pm.lat.toFixed(5)}, ${pm.lon.toFixed(5)}</div>
        </div>
        <div style="font-size:12px">üì∑ ${(pm.photos||[]).length}</div>
      </div>
      ${pm.photos?.length?`<div class="thumbs">${shots}</div>`:''}
    </div>`;
  });
  grpPts.addTo(App.map);
  $('#lst').innerHTML = list;

  const totalPhotos = md.placemarks.reduce((s,p)=>s+(p.photos?.length||0),0);
  $('#k-p').textContent = md.placemarks.length;
  $('#k-f').textContent = totalPhotos;
  $('#k-d').textContent = md.days.length;
  $('#k-t').textContent = md.tracks.length;
  $('#pdf').disabled = false;
  fitAll();
}

function onChangeMonth() {
  const key = $('#sel-month').value;
  if (!key) return;
  App.month = key;
  clearLayers();
  drawMonth(App.all.months[key]);
}

function fitAll() {
  if (App.layers.markers.length) {
    const g=L.featureGroup(App.layers.markers); try{App.map.fitBounds(g.getBounds(),{padding:[30,30]})}catch(e){}
  } else {
    try{const b=App.layers.limite.getBounds(); if(b && b.isValid()) App.map.fitBounds(b,{padding:[30,30]})}catch(e){}
  }
}

function toggleTracks(){
  if (App.tracksVisible) App.layers.tracks.forEach(l=>App.map.removeLayer(l)); else App.layers.tracks.forEach(l=>l.addTo(App.map));
  App.tracksVisible=!App.tracksVisible;
}

async function exportPDF(){
  const { jsPDF } = window.jspdf; if (!App.month) return; const md=App.all.months[App.month];
  const pdf=new jsPDF('p','mm','a4'); const W=pdf.internal.pageSize.getWidth(); const m=14;
  pdf.setFillColor(11,122,110); pdf.rect(0,0,W,58,'F'); pdf.setTextColor(255,255,255);
  pdf.setFontSize(20); pdf.text('RELAT√ìRIO DE RONDA', W/2,22,{align:'center'});
  pdf.setFontSize(14); pdf.text(md.name.replace(/^./,c=>c.toUpperCase()), W/2,34,{align:'center'});
  pdf.setTextColor(0,0,0); pdf.setFontSize(10);
  
// === CAPA: screenshot do mapa enquadrado (Limite + UPA + UMF + Trajetos) ===
// === CAPA: centraliza no LIMITE, espera 3s, tira print e adiciona ao PDF ===
try {
  // 0) Encontrar bounds (prioridade: LIMITE ‚Üí UPA/UMF ‚Üí tracks/markers)
  const findBounds = () => {
    const LAY = { limite: [], upa: [], umf: [], tracks: [], markers: [] };
    if (App.layers?.limite) LAY.limite.push(App.layers.limite);
    if (Array.isArray(App.layers?.tracks)) LAY.tracks.push(...App.layers.tracks);
    if (Array.isArray(App.layers?.markers)) LAY.markers.push(...App.layers.markers);

    App.map.eachLayer((l) => {
      try {
        const hint = [
          l?.options?.name, l?.options?.className, l?.options?.pane,
          l?.feature?.properties ? JSON.stringify(l.feature.properties) : ''
        ].join(' ').toLowerCase();

        if (/limite|per[i√≠]metro|boundary|fazenda|pol[i√≠]gono/.test(hint)) LAY.limite.push(l);
        if (/(^|\W)upa(\W|$)|unidade de produ[c√ß][a√£]o anual|ano manejo/.test(hint)) LAY.upa.push(l);
        if (/(^|\W)umf(\W|$)|unidade de manejo florestal|manejo/.test(hint)) LAY.umf.push(l);
        if (/trajet|track|rota|gps|caminho|linha|polyline/.test(hint)) LAY.tracks.push(l);
      } catch(_) {}
    });

    const pickBounds = (arrs) => {
      const layers = [];
      arrs.flat().forEach(l => { if (l && typeof l.getBounds === 'function') layers.push(l); });
      if (!layers.length && (LAY.markers.length || LAY.tracks.length)) {
        const fg = L.featureGroup([
          ...LAY.markers.filter(m => m.getLatLng).map(m => L.marker(m.getLatLng())),
          ...LAY.tracks
        ]);
        layers.push(fg);
      }
      if (!layers.length) return null;
      const fg = L.featureGroup(layers);
      const b = fg.getBounds();
      return (b?.isValid && b.isValid()) ? b : null;
    };

    return (
      pickBounds([LAY.limite]) ||
      pickBounds([ ...LAY.upa, ...LAY.umf ]) ||
      pickBounds([LAY.tracks])
    );
  };

  const bounds = findBounds();

  if (bounds) {
    // 1) Centraliza com anima√ß√£o e aguarda terminar (exatamente 3s)
    const b = bounds.pad(0.06);
    App.map.flyToBounds(b, { animate: true, duration: 3 });

    // Espera BOTH: moveend e 3s ‚Äî sem travar se algum faltar
    await Promise.allSettled([
      new Promise(res => App.map.once('moveend', res)),
      new Promise(res => setTimeout(res, 3000))
    ]);
  }

  // 2) Garante estado est√°vel e tiles renderizados
  if (App.map?.invalidateSize) App.map.invalidateSize(true);
  await new Promise(r => requestAnimationFrame(() => requestAnimationFrame(r)));

  // 3) Screenshot do mapa (abaixo do t√≠tulo/KPIs; sem tela cheia)
  const mapaDiv = document.getElementById('map');
  const canvas = await html2canvas(mapaDiv, { useCORS: true, scale: 1, backgroundColor: null });
  const img = canvas.toDataURL('image/png');

  const pageW = pdf.internal.pageSize.getWidth();
  const pageH = pdf.internal.pageSize.getHeight();
  const yTop  = 84;                  // abaixo do t√≠tulo e KPIs
  const maxW  = pageW - 2 * m;
  const maxH  = pageH - m - yTop;
  const aspect = canvas.width / canvas.height;

  let drawW = maxW, drawH = drawW / aspect;
  if (drawH > maxH) { drawH = maxH; drawW = drawH * aspect; }
  const xLeft = (pageW - drawW) / 2;

  pdf.addImage(img, 'PNG', xLeft, yTop, drawW, drawH);
} catch (e) {
  console.warn('Falha ao capturar mapa na capa (continua relat√≥rio):', e);
}
// === FIM CAPA ===


  // === FIM CAPA ===
const totalPhotos = md.placemarks.reduce((s,p)=>s+(p.photos?.length||0),0);
  pdf.text(`Pontos: ${md.placemarks.length}  |  Fotos: ${totalPhotos}  |  Dias: ${md.days.length}  |  Trajetos: ${md.tracks.length}`, m, 72);
  for (let i=0;i<md.placemarks.length;i++) {
    const pm=md.placemarks[i]; for (let j=0;j<(pm.photos?.length||0); j+=2) {
      pdf.addPage(); pdf.setFillColor(224,242,241); pdf.rect(0,0,W,32,'F');
      pdf.setFontSize(12); pdf.setTextColor(11,122,110); pdf.text(`Ponto ${i+1} ‚Äî ${pm.name}`, m, 12);
      pdf.setTextColor(0,0,0); pdf.setFontSize(10);
      pdf.text(`Data: ${String(pm.day).padStart(2,'0')}/${String(pm.month).padStart(2,'0')}/${pm.year}`, m, 20);
      pdf.text(`Coordenadas: ${pm.lat.toFixed(6)}, ${pm.lon.toFixed(6)}`, m+70, 20);
      const y0=38, w=180, h=100, x=(W-w)/2; const n=Math.min(2,(pm.photos.length-j));
      for (let k=0;k<n;k++) { const ph=pm.photos[j+k]; pdf.addImage(`data:image/jpeg;base64,${ph.data}`,'JPEG',x,y0+k*(h+8),w,h); pdf.setFontSize(8); pdf.setTextColor(100,100,100); pdf.text(ph.name, m, y0+(k+1)*(h+8)-2); }
    }
  }
  pdf.save(`Relatorio_Ronda_${md.name.replace(/\s+/g,'_')}.pdf`);
}

function showModal(src, name, lat, lon) {
  const m = document.getElementById('modal');
  document.getElementById('modal-img').src = src;
  document.getElementById('modal-meta').textContent = `${name} ‚Äî Lat: ${(+lat).toFixed(6)} ‚Ä¢ Lon: ${(+lon).toFixed(6)}`;
  m.style.display = 'flex';
}
function hideModal(){ document.getElementById('modal').style.display = 'none'; }
window.goToPoint=(idx)=>{ const pm=App.all.months[App.month].placemarks[idx]; App.map.flyTo([pm.lat,pm.lon],15); App.layers.markers[idx].openPopup(); }

function wire(){
  $('#fit').onclick=fitAll; $('#trk').onclick=toggleTracks; $('#pdf').onclick=exportPDF;
  $('#file-kmz').addEventListener('change', e=>{ const f=e.target.files?.[0]; if (f) startWith(f); });
  const up = $('#upload'); up.addEventListener('dragover', e=>{ e.preventDefault(); up.style.outline='2px dashed #fff'; });
  up.addEventListener('dragleave', e=>{ e.preventDefault(); up.style.outline='none'; });
  up.addEventListener('drop', async e=>{ e.preventDefault(); up.style.outline='none'; const files=Array.from(e.dataTransfer.files||[]); const kmz=files.find(f=>/\.(kmz|kml)$/i.test(f.name)); if (kmz) startWith(kmz); else toast('Solte um arquivo .kmz ou .kml'); });
}
wire();
</script>

<!-- injected: mobile responsive script v2 -->
<script id="mobile-responsive-script">
(function() {
  function setVH() {
    const vh = window.innerHeight * 0.01;
    document.documentElement.style.setProperty('--vh', vh + 'px');
  }
  setVH();
  window.addEventListener('resize', setVH);
  window.addEventListener('orientationchange', setVH);

  // Add a simple mobile topbar if not present
  document.addEventListener('DOMContentLoaded', function() {
    var sidebar = document.querySelector('#sidebar, .sidebar, .sidepanel, .panel-left');
    var hasTopbar = document.querySelector('.mobile-topbar');
    if (!hasTopbar) {
      var topbar = document.createElement('div');
      topbar.className = 'mobile-topbar';
      topbar.innerHTML = '<button id="mobileMenuBtn" class="btn btn-light" aria-label="Menu">‚ò∞</button><div style="font-weight:600;">Visualizador</div>';
      document.body.appendChild(topbar);
      document.body.classList.add('mobile-safe');
      var btn = topbar.querySelector('#mobileMenuBtn');
      if (btn && sidebar) {
        btn.addEventListener('click', function(){
          sidebar.classList.toggle('open');
        });
      } else if (btn && !sidebar) {
        btn.style.display = 'none';
      }
    }
    // Also add a floating toggle if a sidebar exists (for one-handed access)
    if (sidebar) {
      var floatBtn = document.createElement('button');
      floatBtn.className = 'sidebar-toggle btn btn-primary';
      floatBtn.textContent = 'Menu';
      floatBtn.addEventListener('click', function(){
        sidebar.classList.toggle('open');
      });
      document.body.appendChild(floatBtn);
      // Close drawer when clicking outside
      document.addEventListener('click', function(e){
        if (!sidebar.classList.contains('open')) return;
        if (!sidebar.contains(e.target) && !floatBtn.contains(e.target) && !(e.target.closest('.mobile-topbar'))) {
          sidebar.classList.remove('open');
        }
      });
    }
  });
})();
</script>
